import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import styles from "./app.module.css";
import { Main } from "./pages";

function App() {
  return (
    <Router>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
        </ul>
      </nav>
      <Route exact path="/" component={Main} />
    </Router>
  );
}

export default App;
